import React, { useState, useEffect } from 'react';
import { Box, Typography, List,Item } from '@mui/material';
import ProfileService from '../api/ProfileService';

function Profile() {
  const [user, setUser] = useState(null);

  useEffect(() => {
    async function fetchProfile() {
      try {
        const profile = await ProfileService.getProfile();
        setUser(profile);
      } catch (error) {
        console.error('Failed to fetch profile:', error);
      }
    }

    fetchProfile();
  }, []);

  if (!user) {
    return <Typography>Loading...</Typography>;
  }

  return (
    <Box>
      <Typography variant="h4">{user.firstName}</Typography>
      <Typography variant="subtitle1">{user.email}</Typography>
      <List>
        <ListItem>
          <Typography variant="body1">Username: {user.username}</Typography>
        </ListItem>
        <ListItem>
          <Typography variant="body1">Date of Birth: {user.dob}</Typography>
        </ListItem>
        <ListItem>
          <Typography variant="body1">Address: {user.address}</Typography>
        </ListItem>
        {/* Add more fields as necessary */}
      </List>
    </Box>
  );
}

export default Profile;
